/*
Other ui styels less template from the web
// This file has fallback variables. It specifies the variables themes
// must implement.

// Colors

@text-color: #333;
@text-color-subtle: #777;
@text-color-highlight: #111;
@text-color-selected: @text-color-highlight;

@text-color-info: #5293d8;
@text-color-success: #1fe977;
@text-color-warning: #f78a46;
@text-color-error: #c00;

@background-color-info: #0098ff;
@background-color-success: #17ca65;
@background-color-warning: #ff4800;
@background-color-error: #c00;
@background-color-highlight: hsla(0,0%,0%,.1);
@background-color-selected: @background-color-highlight;

@app-background-color: #fff;

@base-background-color: #fff;
@base-border-color: #eee;

@pane-item-background-color: @base-background-color;
@pane-item-border-color: @base-border-color;

@input-background-color: #fff;
@input-border-color: @base-border-color;

@tool-panel-background-color: #f4f4f4;
@tool-panel-border-color: @base-border-color;

@inset-panel-background-color: #eee;
@inset-panel-border-color: @base-border-color;

@panel-heading-background-color: #ddd;
@panel-heading-border-color: transparent;

@overlay-background-color: #f4f4f4;
@overlay-border-color: @base-border-color;

@button-background-color: #ccc;
@button-background-color-hover: lighten(@button-background-color, 5%);
@button-background-color-selected: @button-background-color-hover;
@button-border-color: #aaa;

@tab-bar-background-color: #fff;
@tab-bar-border-color: darken(@tab-background-color-active, 10%);
@tab-background-color: #f4f4f4;
@tab-background-color-active: #fff;
@tab-border-color: @base-border-color;

@tree-view-background-color: @tool-panel-background-color;
@tree-view-border-color: @tool-panel-border-color;

@ui-site-color-1: @background-color-success; // green
@ui-site-color-2: @background-color-info; // blue
@ui-site-color-3: @background-color-warning; // orange
@ui-site-color-4: #db2ff4; // purple
@ui-site-color-5: #f5e11d; // yellow


// Sizes

@font-size: 13px;
@input-font-size: 14px;

@disclosure-arrow-size: 12px;

@component-padding: 10px;
@component-icon-padding: 5px;
@component-icon-size: 16px;
@component-line-height: 25px;
@component-border-radius: 2px;

@tab-height: 30px;

// Other

@font-family: system-ui;
@use-custom-controls: true; // false uses native controls
*/
.github-PrCommentThread {
  padding: 10px 10px 10px 0;
}
.github-PrComment {
  max-width: 60em;
  padding: 10px;
  font-family: '.SFNSText-Regular', 'SF UI Text', 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 12px;
  border: 1px solid #100c15;
}
.github-PrComment:first-child {
  border-top-left-radius: 2px;
  border-top-right-radius: 2px;
}
.github-PrComment:last-child {
  border-bottom-left-radius: 2px;
  border-bottom-right-radius: 2px;
}
.github-PrComment + .github-PrComment {
  border-top: none;
}
.github-PrComment-header {
  color: #808080;
  line-height: 16px;
}
.github-PrComment-avatar {
  margin-right: 6px;
  height: 16px;
  width: 16px;
  border-radius: 2px;
  vertical-align: top;
}
.github-PrComment-timeAgo {
  color: inherit;
}
.github-PrComment-body {
  margin-left: 22px;
}
.github-PrComment-hidden {
  font-size: 14px;
}
.github-PrComment-icon {
  vertical-align: middle;
}
.github-PrComment .js-suggested-changes-blob {
  font-size: .9em;
  border: 1px solid #100c15;
  border-radius: 2px;
}
.github-PrComment .js-suggested-changes-blob .d-flex {
  display: flex;
}
.github-PrComment .js-suggested-changes-blob .d-inline-block {
  display: inline-block;
}
.github-PrComment .js-suggested-changes-blob .flex-auto {
  flex: 1 1 auto;
}
.github-PrComment .js-suggested-changes-blob .p-1 {
  padding: 5px;
}
.github-PrComment .js-suggested-changes-blob .px-1 {
  padding-left: 5px;
  padding-right: 5px;
}
.github-PrComment .js-suggested-changes-blob .p-2 {
  padding: 10px;
}
.github-PrComment .js-suggested-changes-blob .text-gray {
  color: #808080;
}
.github-PrComment .js-suggested-changes-blob .lh-condensed {
  line-height: 1.25;
}
.github-PrComment .js-suggested-changes-blob .rounded-1 {
  border-radius: 2px;
}
.github-PrComment .js-suggested-changes-blob .border {
  border: 1px solid;
}
.github-PrComment .js-suggested-changes-blob .border-bottom {
  border-bottom: 1px solid #100c15;
}
.github-PrComment .js-suggested-changes-blob .border-green {
  border-color: #73c990;
}
.github-PrComment .js-suggested-changes-blob .octicon {
  vertical-align: -4px;
  fill: currentColor;
}
.github-PrComment .js-suggested-changes-blob .blob-wrapper > table {
  width: 100%;
  margin: 0;
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
  line-height: var(--editor-line-height);
}
.github-PrComment .js-suggested-changes-blob .blob-wrapper > table td {
  border: none;
  padding: 0 .5em;
}
.github-PrComment .js-suggested-changes-blob .blob-num {
  padding: 0 .5em;
  color: #808080;
}
.github-PrComment .js-suggested-changes-blob .blob-num:before {
  content: attr(data-line-number);
}
.github-PrComment .js-suggested-changes-blob .blob-num-addition {
  background-color: rgba(26, 255, 91, 0.25);
}
.github-PrComment .js-suggested-changes-blob .blob-num-deletion {
  background-color: rgba(255, 82, 102, 0.25);
}
.github-PrComment .js-suggested-changes-blob .blob-code-inner:before {
  margin-right: .5em;
}
.github-PrComment .js-suggested-changes-blob .blob-code-inner .x-first {
  border-bottom-left-radius: 2px;
  border-top-left-radius: 2px;
}
.github-PrComment .js-suggested-changes-blob .blob-code-inner .x-last {
  border-bottom-right-radius: 2px;
  border-top-right-radius: 2px;
}
.github-PrComment .js-suggested-changes-blob .blob-code-addition {
  background-color: rgba(26, 255, 91, 0.15);
}
.github-PrComment .js-suggested-changes-blob .blob-code-addition:before {
  content: "+";
}
.github-PrComment .js-suggested-changes-blob .blob-code-addition .x {
  background-color: rgba(56, 224, 98, 0.25);
}
.github-PrComment .js-suggested-changes-blob .blob-code-deletion {
  background-color: rgba(255, 82, 102, 0.15);
}
.github-PrComment .js-suggested-changes-blob .blob-code-deletion:before {
  content: "-";
}
.github-PrComment .js-suggested-changes-blob .blob-code-deletion .x {
  background-color: rgba(251, 86, 105, 0.25);
}
.github-PrComment .js-suggested-changes-blob .tooltipped {
  position: relative;
}
.github-PrComment .js-suggested-changes-blob .tooltipped::after {
  position: absolute;
  z-index: 1000000;
  display: none;
  width: max-content;
  max-width: 22em;
  padding: .5em .6em;
  font-weight: 500;
  color: #241b2f;
  text-align: center;
  pointer-events: none;
  content: attr(aria-label);
  background: #0088ff;
  border-radius: 2px;
}
.github-PrComment .js-suggested-changes-blob .tooltipped::before {
  position: absolute;
  z-index: 1000001;
  display: none;
  width: 0;
  height: 0;
  color: #0088ff;
  pointer-events: none;
  content: "";
  border: 6px solid transparent;
}
.github-PrComment .js-suggested-changes-blob .tooltipped:hover::before,
.github-PrComment .js-suggested-changes-blob .tooltipped:active::before,
.github-PrComment .js-suggested-changes-blob .tooltipped:focus::before,
.github-PrComment .js-suggested-changes-blob .tooltipped:hover::after,
.github-PrComment .js-suggested-changes-blob .tooltipped:active::after,
.github-PrComment .js-suggested-changes-blob .tooltipped:focus::after {
  display: inline-block;
  text-decoration: none;
}
.github-PrComment .js-suggested-changes-blob .tooltipped::after {
  top: 100%;
  right: 50%;
  margin-top: 6px;
}
.github-PrComment .js-suggested-changes-blob .tooltipped::before {
  top: auto;
  right: 50%;
  bottom: -7px;
  margin-right: -6px;
  border-bottom-color: #0088ff;
}
.github-PrComment .js-suggested-changes-blob .tooltipped::after {
  transform: translateX(50%);
}
